import * as api from '../api';


export const fetchUser = (userId) => async (dispatch) => {
  try {

    const { data } = await api.fetchUser(userId);
    console.log("GOT user")
    console.log(data)

    dispatch({
      type: "FETCH_USER",
      payload: data
    })

  } catch (error) {
    console.log(error)
  }
}
